import React from 'react';
import {
    Route,
    NavLink,
    HashRouter
  } from "react-router-dom";
  import Home from "./home";
  import FoodItem from "./pages/foodItems";
  import Contact from "./pages/contact";

class Menu extends React.Component {
    render() {
      return (
        <div className="menu">
          <ul>
              <li>Home</li>
              <li>Menu</li>
              <li>Contact</li>
          </ul>
        </div>
      );
    }
  }

  export default Menu;
